        top: 50%;
        left: 17px;

      }

        }

        }
        li:nth-child(n + 6) {

        }
        li {
          margin: auto 9px;
          justify-content: space-evenly;
          width: 30px;
          height: 30px;
        }
        .time{

        }

          font-size: 24px;
        }

        }

        }
